class Solution:
    def findSubstring(self, s: str, words: list[str]) -> list[int]:

        wordDict = {}
        totalWordLen = 0
        wordLen = 0
        res = []
        print(len(words))
        return

        for word in words:
            if not totalWordLen:
                wordLen = len(word)
                totalWordLen = len(word) * len(words)
            wordDict[word] = wordDict.setdefault(word, 0) + 1

        def wordsFit(curDict, i):
            if not curDict:
                return True
            curWord = s[i:i+wordLen]
            if curWord in wordDict:
                wordDict[curWord] -= 1
                if wordDict[curWord] == 0:
                    wordDict.pop(curWord)
                fit = wordsFit(curDict, i + wordLen)
                if curWord not in wordDict:
                    wordDict[curWord] = 1
                else:
                    wordDict[curWord] += 1
                if fit:
                    return True

        for i in range(len(s) - totalWordLen + 1):
            if wordsFit(wordDict, i):
                res.append(i)

        return res


